import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return ( 
    <div className = "App" >
        <header> 
            <h1>Future Tube</h1> 
            <input type="text" value="Buscar"></input>
        </header>

        <main>
            <div className="card">
                <img src="img_avatar.png" alt="Avatar" style="width:100%"/>
            </div>
            <div className="container">
                <h4><b>John Doe</b></h4>
                <p>Architect & Engineer</p>
            </div>
        </main>

        <nav>Links navegação</nav>

        <footer>Oi, eu moro no footer</footer>

    </div>
    );
}

export default App;
